import Slider from "./page/Slider";
import Content from "./page/Content";


function App() {
  return (
    <div>
      <NaviBar></NaviBar>
      <LandingPage></LandingPage>
      <Content></Content>
      {/* <Slider></Slider> */}
      <div className="title">
         <h1 style={{textAlign: "center"}}>Image Gallery</h1>
      </div>
      <Gallery></Gallery>
      
    </div>
  );
}

export default App;
